def min_cost(cost, m, n):
    dp = [[0 for x in range(n)] for x in range(m)]

    dp[0][0] = cost[0][0]

    for i in range(1, m):
        dp[i][0] = dp[i - 1][0] + cost[i][0]

    for j in range(1, n):
        dp[0][j] = dp[0][j - 1] + cost[0][j]

    for i in range(1, m):
        for j in range(1, n):
            dp[i][j] = min(dp[i - 1][j], dp[i][j - 1]) + cost[i][j]

    return dp[m - 1][n - 1]

