import collections
def rearrange_string(S):
    frequency = collections.Counter(S)
    most_frequent_character = max(frequency, key=lambda chr: frequency[chr])
    most_character_frequency = frequency[most_frequent_character]
    if most_character_frequency > (len(S) + 1) / 2:
        return ""
    result = [""] * len(S)
    idx = 0
    for character, frequency in frequency.most_common():
        while frequency > 0:
            result[idx] = character
            idx += 2
            if idx >= len(S):
                idx = 1
            frequency -= 1
    return ''.join(result)

