def get_total_number_of_sequences(m,n):
    """
    Given two integers, m and n, find the number of possible sequences of length n such that each of the next element is greater than or equal to twice of the previous element
    but less than or equal to m.
    """
    # DP approach
    dp = [[0] * (m+1) for _ in range(n+1)]

    # Base cases
    for i in range(m+1):
        dp[0][i] = 1
    for j in range(1, n+1):
        dp[j][1] = 1

    # Fill the dp table
    for i in range(1, n+1):
        for j in range(2, m+1):
            for k in range(1, j+1):
                if k*2 > j:
                    break
                dp[i][j] += dp[i-1][k]

    # Return the result
    return dp[n][m]

